def get_factors(n, prime_list=primes):
    lim = int(n ** 0.5)
    if prime_list is None:
        prime_list = range(2, lim)
    factors = []
    for p in prime_list:
        if p > lim:
            break
        while n % p == 0:
            factors.append(p)
            n //= p
    if n > 1:
        factors.append(n)
    return factors
